webpackJsonp([30443985273365],{8015:function(e,t){e.exports={data:{post:{html:"<p>The rest of the world may be celebrating Valentine's Day today, but we're so busy with the business (German joke: \"Selbstst&auml;ndig bedeutet immer selbst und st&auml;ndig\") we don't really have time. But considering that we've been together since sometime around Valentine's Day in 1980 (that's so long ago, that Jimmy Carter was President and Helmut Schmidt was Chancellor), a 20 year franchise contract pales in comparison.</p>\n<p>Actually we first met the November before, but the male half was too dense to notice that it could become anything permanent.</p>",fields:{title:"Valentine's Day",date:"14 Feb 2008",url:"https://papascott.de/2008-02-14-valentines-day/"}}},pathContext:{slug:"/2008-02-14-valentines-day/",prev:{fields:{title:"Forty-Six, and One",date:"09 Feb 2008",slug:"/2008-02-09-forty-six-and-one/"}},next:{fields:{title:"Indy Dance",date:"17 Feb 2008",slug:"/2008-02-17-indy-dance/"}}}}}});
